// Acessando diretamente os dados com $json
const item = $json;

const phone = $node["separa_em_lotes"].json["Qual seu telefone (WhatsApp)?"];
const cleanPhone = phone ? phone.toString().replace(/\D/g, '') : '';
const ddd = cleanPhone.slice(2, 4);
const ddi = cleanPhone.slice(0, 2);
const telefoneFormatado = cleanPhone ? (parseInt(ddd, 10) > 28 ? ddi + ddd + cleanPhone.slice(-8) : ddi + ddd + cleanPhone.slice(-9)) : '';

const capitalizeFirstLetter = (str) => str.toString().toLowerCase().replace(/(?:^|\s)\S/g, (a) => a.toUpperCase());

const full_name = capitalizeFirstLetter($node["separa_em_lotes"].json["Qual seu nome?"]) || '';
const email = $node["separa_em_lotes"].json["Qual seu melhor e-mail?"]?.trim().toLowerCase() || '';
const instagram = $node["separa_em_lotes"].json["Qual o Instagram da sua loja de iPhones?"]?.toString().replace('@', '').toLowerCase() || '';
const qtd_iphone = $node["separa_em_lotes"].json["Quais dessas opções mais te definem?"] || '';
const tem_loja_eletronicos = $node["separa_em_lotes"].json["Você possui uma loja de eletrônico e deseja começar a vender iPhones?"] || '';
const vende_outra_marca = $node["separa_em_lotes"].json["Você vende alguma outra marca de Smartphone que não seja Apple?"] || '';
const qtd_vendas_outra_marca = $node["separa_em_lotes"].json["Quantos Smartphones de outras marcas você vende no mês?"] || '';
const capital_inicial = $node["separa_em_lotes"].json["Qual seu capital inicial de investimento para começar vender iPhones?"] || '';
const media_lucro = $node["separa_em_lotes"].json["Qual a sua média de lucro por aparelho vendido?"] || '';
const tem_fornecedor = $node["separa_em_lotes"].json["Você já possui algum fornecedor de iPhones?"] || '';
const qtd_iphone_mes = $node["separa_em_lotes"].json["Quantos iPhones você vende no mês?"] || '';
const impeditivo_100_400_iphones = $node["separa_em_lotes"].json["O que você acredita que está impedindo sua loja de vender de 100 a 400 iPhones todos os meses?"] || '';
const historia = $node["separa_em_lotes"].json["Conte um pouco da história da sua loja..."] || '';
const oportunidade = $node["separa_em_lotes"].json["Porque você acredita que participar da <strong>Consultoria Gratuita</strong> é a oportunidade ideal para você e seu negócio?"] || '';
const utm_source = $node["separa_em_lotes"].json["utm_medium"] || '';
const utm_campaign = $node["separa_em_lotes"].json["utm_campaign"] || '';
const utm_term = $node["separa_em_lotes"].json["utm_term"] || '';
const utm_medium = $node["separa_em_lotes"].json["utm_medium"] || '';
const utm_content = $node["separa_em_lotes"].json["utm_content"] || '';
const sck = $node["separa_em_lotes"].json["sck"] || '';
const Date = $node["separa_em_lotes"].json["Date"] || '';

// Nova variável para armazenar o nível de qualificação
let nivelQualificacao = '';

// Verificar as condições de desqualificação baseadas em qtd_iphone
if (
  qtd_iphone === 'Estou vendendo até 10 iPhones no mês' ||
  qtd_iphone === 'Ainda não comecei a vender iPhones mas quero começar'
) {
  if (qtd_vendas_outra_marca === 'Até 10 Smartphones' || capital_inicial === 'Até R$5.000' || capital_inicial === 'De R$5.001 a R$10.000' || capital_inicial === 'De R$10.001 a R$20.000') {
    nivelQualificacao = 'Desqualificado';
  }
}

// Se não atender às condições de desqualificação, considerar como qualificado
if (!nivelQualificacao) {
  nivelQualificacao = 'Qualificado';
}

// Adicionar a variável de qualificação ao retorno
return {
  telefoneFormatado,
  full_name,
  email,
  instagram,
  qtd_iphone,
  tem_loja_eletronicos,
  vende_outra_marca,
  qtd_vendas_outra_marca,
  capital_inicial,
  media_lucro,
  tem_fornecedor,
  qtd_iphone_mes,
  impeditivo_100_400_iphones,
  historia,
  oportunidade,
  utm_source,
  utm_campaign,
  utm_term,
  utm_medium,
  utm_content,
  sck,
  Date,
  nivelQualificacao
};
